$(document).ready(()=>{"use strict";const externalLinks=()=>{const internalHost=[location.hostname];const protocolPattern=/^https?:\/\//i;$("a").each((index,element)=>{const href=$(element).attr("href");if(protocolPattern.test(href)){const hrefHostname=$(new URL(href)).attr("hostname");if($.inArray(hrefHostname,internalHost)===-1){$(element).attr("target","_blank");$(element).attr("rel","noopener noreferer")}}})};$(document).ajaxSuccess(()=>{externalLinks()});const init=()=>{externalLinks()};init()});